import { useState } from "react";

const Home = () => {
  const [blogs, setBlogs] = useState([
    {title: "My new websiteüòÅ", body: "I'm so glad to...", author: "Ashley", id: 1},
    {title: "Welcome to the party!üíÉüèæ", body: "Great, now that we're all here...", author: "Brian", id: 2},
    {title: "Vacation Timeüå¥", body: "So I'm planning this trip...", author: "Simone", id: 3}
  ]);
  

  return ( 
     <div className="home">
      {blogs.map(blog => (
        <div className="blog-preview" key={blog.id} >
          <h2>{ blog.title }</h2>
          <p>Written by { blog.author }</p>
        </div>
      ))}
    </div>
   );
}
 
export default Home;
